INSERT INTO `categories` (`id`, `name`, `status`, `img`, `created_at`, `updated_at`, `category_type_id`, `description`, `alt`, `template_id`) VALUES
(1, 'Construcción', 1, 'edi1.jpg', '2023-02-13 07:27:17', '2023-02-13 07:27:17', 2, '\n<li>Reformas de cocina</li>\n<li>Reformas de pisos</li>\n<li>Reformas de baños</li>\n<li>Cambios en la distribución de espacios interiores</li>\n<li>Reformas de viviendas, incluyendo pintura, carpintería, fontanería y electricidad.</li>\n<li>Ampliaciones y construcción de nuevas habitaciones</li>\n<li>Reformas de locales comerciales y oficinas</li>\n<li>Instalación de aire acondicionado y sistemas de ventilación</li>\n<li>Instalación de calefacción y sistemas de climatización</li>\n<li>Reformas de fachadas y exteriores</li>\n<li>Impermeabilización de techos y terrazas</li>\n<li>Reformas y mejoras en la accesibilidad de edificios para personas con movilidad reducida.</li>\n<li>Instalación de sistemas de domótica y automatización del hogar.</li>\n<li>Rehabilitación y renovación de edificios antiguos.</li>\n<li>Trabajos de albañilería y construcción de muros y tabiques.</li>\n<li>Instalación de techos falsos y suelos.</li>\n<li>Cambios en la distribución de iluminación interior y exterior.</li>\n', 'Construccion y reformas', 1),
(2, 'Jardinería', 1, 'edi2.jpg', '2023-02-13 07:27:17', '2023-02-13 07:27:17', 2, NULL, 'Mantenimiento', 1),
(3, 'Limpieza', 1, 'cas3.jpg', '2023-02-13 07:27:17', '2023-02-13 07:27:17', 2, '<ul>\n<li>Podas de árboles, arbustos y setos.</li>\n<li>Mantenimiento de jardines y espacios verdes.</li>\n<li>Diseño y construcción de jardines y espacios exteriores.</li>\n<li>Tratamiento de plagas y enfermedades en plantas y árboles.</li>\n<li>Instalación de sistemas de riego y drenaje.</li>\n<li>Instalación de iluminación exterior con tecnología LED</li>\n<li>Mantenimiento de praderas y céspedes.</li>\n<li>Instalación y mantenimiento de piscinas, jacuzzis y fuentes.</li>\n<li>Limpieza y mantenimiento de filtros y sistemas de depuración de agua de piscinas.</li>\n<li>Tratamiento de aguas y control de pH en piscinas y jacuzzis.</li>\n </ul>', 'Jardineria', 1);
