(11, '{\"webhook\":\"PRODUCTS_UPDATE\",\"webhook_origin_payload\":{\"admin_graphql_api_id\":\"gid:\\/\\/shopify\\/Product\\/7954655674566\",\"body_html\":\"<p><strong>Descripci\\u00f3n<\\/strong>:<\\/p><p>Compatible con Bluetooth: Bluetooth-5,3 compatible<br>Duraci\\u00f3n de la bater\\u00eda: aproximadamente 180h<br>Tiempo en espera: aproximadamente 220h<br>Impedancia: 32<br>Entrada nominal: 5V<br>Tama\\u00f1o del altavoz: 8mm<br>Respuesta de frecuencia: 20Hz-20Khz<br>Distancia de transmisi\\u00f3n: 10M<br>Interfaz de carga: Tipo c<br>M\\u00e9todo de cancelaci\\u00f3n: smart touch<br>Versi\\u00f3n de reducci\\u00f3n de ruido: CVC8.0<\\/p><p><strong>Caracter\\u00edsticas:<\\/strong><\\/p><p>1. Efecto de iluminaci\\u00f3n RGB y pantalla de potencia: los auriculares compatibles con Bluetooth tienen efectos de iluminaci\\u00f3n RGB geniales incorporados, funci\\u00f3n de visualizaci\\u00f3n de energ\\u00eda LED y bot\\u00f3n de huella digital. Toque el bot\\u00f3n de la huella digital para leer f\\u00e1cilmente el nivel de la bater\\u00eda de la caja de carga, sin preocuparse por el fallo de energ\\u00eda de la caja de carga.<br>2. Larga duraci\\u00f3n de la bater\\u00eda: puede obtener 180 horas de duraci\\u00f3n de la bater\\u00eda cuando los auriculares est\\u00e1n completamente cargados. Un estuche de carga con una power band integrada de 1200mAh proporciona una larga duraci\\u00f3n de la bater\\u00eda para los auriculares. <strong>Tambi\\u00e9n puedes usar la funda de carga para cargar tu tel\\u00e9fono. Nunca te preocupes por quedarse sin energ\\u00eda.<\\/strong><br>3. Dise\\u00f1o ergon\\u00f3mico: los auriculares impermeables IPX7 vienen con tres tama\\u00f1os diferentes de almohadillas de silicona suave (S, M, L). El dise\\u00f1o de soporte de tres puntos de los auriculares te proporciona una experiencia de uso m\\u00e1s segura. Se adapta perfectamente a tu o\\u00eddo, no tienes que preocuparte de que se caiga.<br>4. Emparejamiento de un paso: no necesita ninguna habilidad para usar los auriculares. Saca los 2 auriculares de la caja de carga, se conectar\\u00e1n autom\\u00e1ticamente entre s\\u00ed y luego ingresar\\u00e1n a la configuraci\\u00f3n compatible con Bluetooth del tel\\u00e9fono para emparejar los auriculares.<\\/p><p>\\u00a0<\\/p>\",\"created_at\":\"2024-02-22T12:58:35-05:00\",\"handle\":\"audifonos-inalambricos-m43-tws-powerband\",\"id\":7954655674566,\"product_type\":\"Tecnologia\",\"published_at\":\"2024-02-22T12:58:35-05:00\",\"template_suffix\":null,\"title\":\"AUDIFONOS INALAMBRICOS M43 TWS-POWERBAND 1\",\"updated_at\":\"2024-03-22T13:35:59-04:00\",\"vendor\":\"Dropi-v1\",\"status\":\"active\",\"published_scope\":\"global\",\"tags\":\"\",\"variants\":[{\"admin_graphql_api_id\":\"gid:\\/\\/shopify\\/ProductVariant\\/43181197623494\",\"barcode\":null,\"compare_at_price\":null,\"created_at\":\"2024-02-22T12:58:35-05:00\",\"fulfillment_service\":\"manual\",\"id\":43181197623494,\"inventory_management\":null,\"inventory_policy\":\"deny\",\"position\":1,\"price\":\"109900.00\",\"product_id\":7954655674566,\"sku\":\"CORRECTORREFORZADA\",\"taxable\":true,\"title\":\"Default Title\",\"updated_at\":\"2024-03-22T13:33:41-04:00\",\"option1\":\"Default Title\",\"option2\":null,\"option3\":null,\"grams\":0,\"image_id\":null,\"weight\":0,\"weight_unit\":\"kg\",\"inventory_item_id\":45283711254726,\"inventory_quantity\":-219,\"old_inventory_quantity\":-219,\"requires_shipping\":true}],\"options\":[{\"name\":\"Title\",\"id\":9983054545094,\"product_id\":7954655674566,\"position\":1,\"values\":[\"Default Title\"]}],\"images\":[{\"id\":36342352216262,\"product_id\":7954655674566,\"position\":1,\"created_at\":\"2024-02-22T12:58:35-05:00\",\"updated_at\":\"2024-02-22T12:58:35-05:00\",\"alt\":null,\"width\":443,\"height\":441,\"src\":\"https:\\/\\/cdn.shopify.com\\/s\\/files\\/1\\/0619\\/8591\\/5078\\/products\\/b23be4ed941ab4bfe674f84b4139f024.jpg?v=1708624715\",\"variant_ids\":[],\"admin_graphql_api_id\":\"gid:\\/\\/shop