(3, 'Reforma de  pisos', '2023-02-13 07:27:17', '2023-02-13 07:27:17', '', 'Reformas de pisos', 1, 0, '3.jpg', '¡Bienvenidos a SOLUCIONES INTEGRALES MALLORCA! <rb> Donde la calidad y el diseño se unen para crear hogares excepcionales Permíteme presentarte una de nuestras más recientes creaciones: <br> una importante foto de un piso recién reformado que estamos seguros te dejará con ganas de conocer más acercar de nuestros servicios.', 'El suelo de parquet tiene un acabado pulido y satinado que refleja la luz de las ventanas del techo y las luces del salón. Los tonos cálidos y naturales de la madera dan una sensación acogedora y hogareña, mientras que la instalación en patrón de espina de pescado agrega un toque de sofisticación y estilo.', '<img src=\"http://localhost/proyecto_/public/layout1/img/descrip/p1.jpeg\" alt=\"modelo reforma pisos 1\" title=\"modelo reforma pisos 1 \" class=\"rounded img-fluid my-2\"><img src=\"http://localhost/proyecto_/public/layout1/img/descrip/p2.jpeg\" alt=\"modelo refoma pisos 2\" title=\"modelo reforma pisos 2\" class=\"rounded img-fluid my-2\"> <img src=\"http://localhost/proyecto_/public/layout1/img/descrip/p3.jpeg\" alt=\"modelo refoma pisos 3\" class=\"rounded img-fluid my-2\" title=\"modelo reforma pisos 3\"> <img src=\"http://localhost/proyecto_/public/layout1/img/descrip/p4.jpeg\" alt=\"modelo refoma pisos 4\" class=\"rounded img-fluid my-2\" title=\"modelo reforma pisos 4\"> <img src=\"http://localhost/proyecto_/public/layout1/img/descrip/p5.jpeg\" alt=\"modelo refoma pisos 5\" title=\"modelo refoma pisos 5\" class=\"rounded img-fluid my-2\"> <img src=\"http://localhost/proyecto_/public/layout1/img/descrip/p6.jpeg\" alt=\"modelo refoma pisos 6 \" class=\"rounded img-fluid my-2\" title=\"modelo reforma pisos 5\">', 'REFORMA DE PISOS', 1, 1),
