(22, 'Reforma de baño', '2023-02-13 07:27:17', '2023-02-13 07:27:17', '', 'Reforma de baño', 1, 1, '22.jpg', 'Nos complace presentarles una de nuestras más reciente remodelaciones de baño. En nuestra búsqueda por hacer realidad los sueños de nuestros clientes, nos enorgullece presentar esta espectacular transformación. <br>', 'Renovar su baño puede aumentar el valor de su hogar y mejorar su calidad de vida', '<img src=\"http://localhost/proyecto_/public/layout1/img/descrip/b4.jpeg\" alt=\"modelo reforma baño 1\" title=\"modelo reforma baño 1\" class=\"rounded img-fluid my-2\"><img src=\"http://localhost/proyecto_/public/layout1/img/descrip/b3.jpeg\" alt=\"modelo reforma baño 2\" title=\"modelo reforma baño 2\" class=\"rounded img-fluid my-2\"> <img src=\"http://localhost/proyecto_/public/layout1/img/descrip/b2.jpeg\" alt=\"modelo reforma baño 3\" title=\"modelo reforma baño 3\" class=\"rounded img-fluid my-2\"> <img src=\"http://localhost/proyecto_/public/layout1/img/descrip/b1.jpeg\" alt=\"modelo reforma baño 4\" title=\"modelo reforma baño 4\" class=\"rounded img-fluid my-2\">', 'SERVICIOS DE CONSTRUCCION', 1, 1),
(23, 'Reforma de cocina', '2023-02-13 07:27:17', '2023-02-13 07:27:17', '', 'Reforma cocina', 1, 1, '23.jpg', 'Nos complace presentarles una de nuestras más reciente remodelaciones de cocina. <br>En nuestra búsqueda por hacer realidad los sueños de nuestros clientes, nos enorgullece presentar esta espectacular transformación. <br></p><p> La combinación de materiales de alta calidad le da un toque sofisticado a esta cocina. La iluminación también juega un papel importante en esta remodelación. Una combinación de luces empotradas y lámparas colgantes crean un ambiente acogedor y calidad. Además, la inclusión de una isla central proporciona un espacio adicional para preparar alimentos y permitir la interacción entre los habitantes del hogar. </p><br><p>En definitiva, esta remodelación cocina es el resultado de nuestro compromiso de ofrecer a nuestros clientes locuciones personalizadas de alta calidad para satisfacer sus necesidades. </p><p>Contáctanos hoy y descubre como podemos ayudar a hacer realidad tus proyectos de construcción!. En la imagen, podemos ver una cocina moderna, elegante y funcional. El uso inteligente del espacio ha permitido maximizar su capacidad de almacenamiento se sacrificar el estilo y la belleza del diseño.', '.', '<img src=\"http://localhost/proyecto_/public/layout1/img/descrip/c4.jpeg\" alt=\"modelo reforma cocina 1\" title=\"modelo reforma cocina 1\" class=\"rounded img-fluid my-2 \"><img src=\"http://localhost/proyecto_/public/layout1/img/descrip/c3.jpeg\" alt=\"modelo reforma cocina 2\"  title=\"modelo reforma cocina 2\" class=\"rounded img-fluid my-2 \"> <img src=\"http://localhost/proyecto_/public/layout1/img/descrip/c2.jpeg\" alt=\"modelo reforma cocina 3\"  title=\"modelo reforma cocina 3\"  class=\"rounded img-fluid my-2 \"><img src=\"http://localhost/proyecto_/public/layout1/img/descrip/c1.jpeg\" alt=\"modelo reforma cocina 4\"  title=\"modelo reforma cocina 4\"  class=\"rounded img-fluid my-2 \">', 'REFORMA DE COCINAS', 1, 1),
