INSERT INTO `user_recommendations` (`id`, `comment`, `user_id`, `status`, `created_at`, `updated_at`, `calification`) VALUES
(1, 'No pensé que mi casa pudiera ser tan hermosa y funcional hasta que vi el resultado final de la remodelación. Ahora tengo mucho más espacio y comodidad para vivir en mi hogar.', 3, 1, '2023-05-18 17:15:29', '2023-05-18 17:15:29', 5),
(2, 'Desde el primer contacto hasta la finalización del proyecto, el equipo de construcción entregó una obra maestra que superó todas mis expectativas. Mi casa nunca se ha visto ni se ha sentido tan increíble como ahora.', 4, 1, '2023-05-18 17:15:29', '2023-05-18 17:15:29', 5),
(3, 'La atención al detalle y la meticulosidad en cada paso del proceso de remodelación de mi baño son simplemente impresionantes. Ahora puedo darme un baño como si estuviera en un spa.', 5, 1, '2023-05-18 17:15:29', '2023-05-18 17:15:29', 5),
(4, 'El equipo de construcción fue proactivo y siempre se aseguró de que estuviera al tanto de cada detalle para asegurarse de que mi remodelación fuera todo lo que yo esperaba y más.', 6, 1, '2023-05-18 17:15:29', '2023-05-18 17:15:29', 5);
